import React from 'react';
import ListItemComponent from './ListItemComponent';

export default class ListComponent extends React.Component {
    render() {
        return (
        <ul
            style={this.props.inputsyle}
        >
            <ListItemComponent></ListItemComponent>
        </ul>
        )
    };
}
